node.text:
Rye Resting.
.
.
Z życzeniami odsyłamy do pozbawionego złudzeń, trzeźwego i rzetelnego świątecznego wpisu @dziewuchy_dziewuchom, za który jestem osobiście wdzięczna. 
Wesoło bowiem nie jest. A nawet jest, po prawdzie, bardzo niewesoło. 
Zatem osobiście życzymy po prostu godnych świąt. No i #drinkmorewine ponieważ, jak mawiają Rosjanie, 'biez flaszki nie razbieriosz'.
Jednocześnie dziękuję i kłaniam się nisko wszyskim serdecznym, bez których rzeczywistość skrzeczałaby całkiem nie do zniesienia.
